insert  into `view`(`id`,`name`,`description`,`project_id`,`source_id`,`sql`,`model`,`variable`,`config`,`create_by`,`create_time`,`update_by`,`update_time`,`parent_id`,`full_parent_id`,`is_folder`,`index`) values (1,'员工每日收款明细','按天统计店员的销售额',1,1,'SELECT * FROM dt_staff_paymt_amt','{\"id\":{\"sqlType\":\"INT\",\"visualType\":\"number\",\"modelType\":\"category\"},\"payment_date\":{\"sqlType\":\"DATE\",\"visualType\":\"date\",\"modelType\":\"category\"},\"staff_id\":{\"sqlType\":\"INT\",\"visualType\":\"number\",\"modelType\":\"category\"},\"first_name\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"last_name\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"amount\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"}}','[]','',2,'2020-06-09 10:31:49',NULL,NULL,NULL,NULL,NULL,NULL),(2,'收益分析','收益趋势分析',2,2,'SELECT \nb_species,\nDATE_FORMAT(order_dt,\'%Y-%m-%d\') o_dt,\nprofit\nFROM `ods_tb_order` \n\n\nWHERE DATE_FORMAT(order_dt,\'%Y-%m-%d\') >= DATE_FORMAT(DATE_ADD(NOW(),INTERVAL -7 DAY),\'%Y-%m-%d\')  \n;','{\"b_species\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"o_dt\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"profit\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"}}','[]','',2,'2020-07-08 14:39:43',2,'2020-07-10 08:33:30',NULL,NULL,NULL,NULL),(3,'投产分析','投入产出分析',2,2,'SELECT \nv4.b_species ,\nv4.pai_ming,\nMAX(v4.one_price) AS one_price,\nAVG(v4.one_price) * 51 AS week_one_price,\nSUM(v4.day_profit) AS week_profit,\n\nAVG(v4.one_price) * 51 / SUM(v4.day_profit) AS tou_chan_rate,\nSUM(v4.day_profit) / (AVG(v4.one_price) * 51)  AS chan_tou_rate,\n\nSUM(v4.day_profit) / (AVG(v4.one_price) * 51) * (365 / 7) AS last_year_rate\n\nFROM \n(\nSELECT \nDATE_FORMAT(v1.order_dt,\'%Y-%m-%d\') AS order_dt\n,v1.`b_species`\n,v2.pai_ming\n\n,MAX(v3.one_price) AS one_price\n,SUM(v1.profit) AS day_profit\n\nFROM `ods_tb_order` AS v1\nLEFT JOIN `b_base_info` AS v2 ON v1.b_species = CONCAT(v2.b_name,\'/USDT\')\nLEFT JOIN `b_buy_price_detail` v3 ON v2.id = v3.fk_b_id AND v1.order_dt >= v3.create_time AND v1.order_dt < end_time\n\nWHERE 1 = 1\n\n-- and DATE_FORMAT(v1.order_dt,\'%Y-%m-%d\') >= DATE_FORMAT(DATE_ADD(NOW(),INTERVAL -7 DAY),\'%Y-%m-%d\')  \n\nAND DATE_FORMAT(v1.order_dt,\'%Y-%m-%d\') >= $start_date$\nAND DATE_FORMAT(v1.order_dt,\'%Y-%m-%d\') <= $end_date$ \n\nGROUP BY DATE_FORMAT(v1.order_dt,\'%Y-%m-%d\'),v2.pai_ming,v1.`b_species`\n\n) v4\nGROUP BY v4.b_species,v4.pai_ming\n\n;','{\"b_species\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"pai_ming\":{\"sqlType\":\"INT\",\"visualType\":\"number\",\"modelType\":\"value\"},\"one_price\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"},\"week_one_price\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"},\"week_profit\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"},\"tou_chan_rate\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"},\"chan_tou_rate\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"},\"last_year_rate\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"}}','[{\"name\":\"start_date\",\"alias\":\"开始日期\",\"type\":\"query\",\"valueType\":\"date\",\"udf\":true,\"key\":\"rgDbC\",\"defaultValues\":[\"DATE_FORMAT(DATE_ADD(now(),INTERVAL -7 DAY),\'%Y-%m-%d\')\"]},{\"name\":\"end_date\",\"alias\":\"结束日期\",\"type\":\"query\",\"valueType\":\"string\",\"udf\":true,\"defaultValues\":[\"date_format(now(),\'%Y-%m-%d\')\"],\"key\":\"5gtRa\"}]','',2,'2020-08-04 13:56:01',2,'2020-08-31 17:52:00',NULL,NULL,NULL,NULL),(4,'币种占用资金明细','币种占用资金明细',2,2,'SELECT \nv2.fk_b_id,\nv2.one_price,\nv3.`b_name`\nFROM (\n		SELECT\n                v1.fk_b_id,\n                v1.one_price              \n            FROM\n                `b_buy_price_detail` v1              \n            WHERE\n                v1.`end_time` = \'2030-12-31 12:00:00\'\n) v2 \nLEFT JOIN `b_base_info` v3 ON v2.fk_b_id = v3.`id`;','{\"fk_b_id\":{\"sqlType\":\"INT\",\"visualType\":\"number\",\"modelType\":\"value\"},\"one_price\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"},\"b_name\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"}}','[]','',2,'2020-08-25 18:01:49',2,'2020-08-25 18:10:08',NULL,NULL,NULL,NULL),(5,'订单明细表','订单明细表',2,2,'select * FROM `ods_tb_order` ;','{\"id\":{\"sqlType\":\"INT\",\"visualType\":\"number\",\"modelType\":\"category\"},\"exchange\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"account\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"b_species\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"order_no\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"rule_type\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"transaction_type\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"b_nums\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"},\"single_price\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"},\"profit\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"},\"profit_per\":{\"sqlType\":\"DOUBLE\",\"visualType\":\"number\",\"modelType\":\"value\"},\"status\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"remark\":{\"sqlType\":\"VARCHAR\",\"visualType\":\"string\",\"modelType\":\"category\"},\"last_ut\":{\"sqlType\":\"TIMESTAMP\",\"visualType\":\"date\",\"modelType\":\"category\"},\"order_dt\":{\"sqlType\":\"TIMESTAMP\",\"visualType\":\"date\",\"modelType\":\"category\"}}','[]','',2,'2020-08-27 15:12:19',NULL,NULL,NULL,NULL,NULL,NULL),(